import React, { useEffect } from 'react';

export default function AdminHome() {
  useEffect(() => {
    useEffect(() => {
      if (localStorage.getItem('sur-uid')) navigate('/admin/home');
      else navigate('/admin/login');
    });
  });
  return <div>AdminHome</div>;
}
